import React, { useState } from "react";
import { fetchOrgaoInfo } from "../api/pncpAPI";
import { InfoOrgao, InfoContrato } from "../tipos/index";

const Search: React.FC = () => {
  const [cnpj, setCnpj] = useState("");
  const [dataInicial, setDataInicial] = useState("");
  const [dataFinal, setDataFinal] = useState("");
  const [orgao, setOrgao] = useState<InfoOrgao | null>(null);
  const [contratos, setContratos] = useState<InfoContrato[]>([]);
  const [error, setError] = useState<string | null>(null);

  const handleSearch = async () => {
    setError(null);
    const data = await fetchOrgaoInfo(cnpj, dataInicial, dataFinal, 1);
    if (data) {
      setOrgao(data.orgao);
      setContratos(data.contratos);
    } else {
      setError("Não foi possível encontrar informações para o CNPJ informado.");
    }
  };

  return (
    <div className="flex flex-col min-h-screen bg-white p-4 justify-center">
      <h1 className="text-4xl font-bold text-[#59D27C] mb-6">OrgSearch</h1>
      <div className="flex items-center justify-between bg-[#59D27C] rounded-lg p-6 shadow-lg w-full max-w-md">
        <div className="flex-1 mr-4">
          <input
            type="text"
            placeholder="CNPJ"
            value={cnpj}
            onChange={(e) => setCnpj(e.target.value)}
            className="border rounded-lg p-2 mb-4 w-full"
          />
          <input
            type="date"
            value={dataInicial}
            onChange={(e) => setDataInicial(e.target.value)}
            className="border rounded-lg p-2 mb-4 w-full"
          />
          <input
            type="date"
            value={dataFinal}
            onChange={(e) => setDataFinal(e.target.value)}
            className="border rounded-lg p-2 mb-4 w-full"
          />
          <button
            onClick={handleSearch}
            className="bg-white text-[#92E3A9] font-bold py-2 px-4 rounded-lg shadow hover:bg-[#92E3A9] hover:text-white transition duration-300"
          >
            Buscar contratos
          </button>
        </div>
        <div className="flex-shrink-0">
          <img
            src="/imagens/maosLupa.gif"
            alt="imagem busca"
            className="h-24" // Ajuste a altura conforme necessário
          />
        </div>
      </div>

      {error && <p className="text-red-600 mt-4">{error}</p>}

      {orgao && (
        <div className="mt-6 text-black">
          <h2 className="text-2xl font-bold mb-2">Informações do Órgão</h2>
          <p>Razão Social: {orgao.razaoSocial}</p>
          <p>CNPJ: {orgao.cnpj}</p>
          <p>UF: {orgao.ufNome}</p>
          <p>Município: {orgao.municipioNome}</p>
        </div>
      )}

      {contratos.length > 0 && (
        <div className="mt-6">
          <h2 className="text-2xl font-bold mb-2">Contratos</h2>
          <ul className="list-disc pl-5">
            {contratos.map((contrato, index) => (
              <li key={index} className="mb-4">
                <p>Número: {contrato.numeroContratoEmpenho}</p>
                <p>Data Início: {contrato.dataVigenciaInicio}</p>
                <p>Data Fim: {contrato.dataVigenciaFim}</p>
                <p>Fornecedor: {contrato.nomeRazaoSocialFornecedor}</p>
                <p>Objeto: {contrato.objetoContrato}</p>
                <p>Valor: {contrato.valorInicial}</p>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default Search;
